import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

const User = props => (
  <tr>
    <td>{props.user.username}</td>
    <td>{props.user.sex}</td>
    <td>{props.user.phone}</td>
    <td>{props.user.email}</td>
    <td>
      <Link to={"/edituser/"+props.user._id}>edit</Link> | <a href="#" onClick={() => { props.deleteUser(props.user._id) }}>delete</a>
    </td>
  </tr>
)

export default class profile extends Component {
  constructor(props) {
    super(props);

    this.deleteUser = this.deleteUser.bind(this)

    this.state = {users: []};
  }

  componentDidMount() {
    axios.get('http://localhost:5000/users/')
      .then(response => {
        this.setState({ users: response.data })
      })
      .catch((error) => {
        console.log(error);
      })
  }

  deleteUser(id) {
    axios.delete('http://localhost:5000/users/'+id)
      .then(response => { console.log(response.data)});

    this.setState({
      users: this.state.users.filter(el => el._id !== id)
    })
  }

  userList() {
    return this.state.users.map(currentuser => {
      return <User user={currentuser} deleteUser={this.deleteUser} key={currentuser._id}/>;
    })
  }

  render() {
    return (
      <>
      <div class="container">
          <div class="form-group">
              <h6 class="mb-0 text-black-60">User Name: {req.body.username}</h6>
              <br></br>
              <h6 class="mb-0 text-black-60">Sex: {req.body.sex}</h6>
              <br></br>
              <h6 class="mb-0 text-black-60">P: {req.body.sex}</h6>
              <br></br>
              <h6 class="mb-0 text-black-60">Sex: {req.body.sex}</h6>
              <br></br>
              <h6 class="mb-0 text-black-60">Sex: {req.body.sex}</h6>
              <br></br>
            { this.userList() }
        </div>
        </div>
      </>
    )
  }
}
